`,p(t.p,{children:"In this document, some words are frequently mentioned, which we find important to specify the meaning of:"}),`
`,p(t.ul,{children:[`
`,p(t.li,{children:[p(t.strong,{children:"repository"}),": ",p(t.em,{children:"(or git repository)"})," is a container for files, commits (changes), and other project information. (what we save and archive)"]}),`
`,p(t.li,{children:[p(t.strong,{children:"GitArchived"}),": the \u201Cplatform\u201D."]}),`
`]}),`
`,p(t.p,{children:"This document outlines the terms of use, privacy policy, and terms of service of GitArchived."}),`
`,p(t.p,{children:p(t.em,{children:"The creators of the repositories are accountable only through the original platform (specified on each repository). In case the user or organization has been deleted, contact the original platform."})}),`
`,p(t.h2,{id:"terms-of-use",children:"Terms of Use"}),`
`,p(t.p,{children:"Date: March 5, 2024"}),`
`,p(t.h3,{id:"1-content-of-the-archive",children:"1. Content of the Archive"}),`
`,p(t.h4,{id:"11-responsibility",children:"1.1 Responsibility"}),`
`,p(t.p,{children:"GitArchived does not assume any direct responsibility for the content of the repositories in the registry. However, we commit to complying with applicable laws and our internal policies and take appropriate action in case of violation. We reserve the right to act, including the removal of content, in compliance with relevant legislation and our internal rules."}),`
`,p(t.h4,{id:"12-violations-of-national-laws",children:"1.2 Violations of National Laws"}),`
`,p(t.p,{children:"GitArchived allows downloads from any country. However, if the content of a repository in the archive is prohibited in a specific country, the responsibility lies with the user who downloads and uses the content."}),`
`,p(t.h4,{id:"13-content-not-suitable-for-minors",children:"1.3 Content not Suitable for Minors"}),`
`,p(t.p,{children:"GitArchived, not having rights over the content and not knowing the content of the repositories, cannot in any way report whether a repository contains sensitive materials. It is up to the user to manage this autonomously."}),`
`,p(t.h4,{id:"14-copyright-and-license-violation",children:"1.4 Copyright and License Violation"}),`
`,p(t.p,{children:["GitArchived respects copyright and is committed to promptly removing content that violates copyright laws. Users can request the removal of content they believe infringes their copyright by sending a complete notice of complaint to ",p(t.a,{href:"mailto:abuse@gitarchived.org",children:"abuse@gitarchived.org"}),". GitArchived will review the requests and act accordingly in accordance with applicable law."]}),`
`,p(t.h3,{id:"2-changes-to-the-terms-of-service",children:"2. Changes to the Terms of Service"}),`
`,p(t.h4,{id:"21-modifications",children:"2.1 Modifications"}),`
`,p(t.p,{children:"GitArchived reserves the right to modify the terms of use at its discretion. Users will be notified in case of changes."}),`
`,p(t.h2,{id:"3-usage",children:"3. Usage"}),`
`,p(t.h4,{id:"31-attribution-and-copyright",children:"3.1 Attribution and Copyright"}),`
`,p(t.p,{children:"GitArchived has no rights over the repositories saved in the registry since they belong to the rightful owner, but has the right to save them. Therefore, attributing the repository to GitArchived is not necessary."}),`
`,p(t.h4,{id:"32-use-of-repositories",children:"3.2 Use of Repositories"}),`
`,p(t.p,{children:"As mentioned earlier, GitArchived has no rights over the repositories, so any modification, use, etc., must be done respecting the native license with which it was distributed by the creator."}),`
`,p(t.h4,{id:"33-use-for-research",children:"3.3 Use for Research"}),`
`,p(t.p,{children:"GitArchived allows its total use for research of any kind, as long as it is carried out in full compliance with the laws of the territory."}),`
`,p(t.h2,{id:"privacy-policy",children:"Privacy Policy"}),`
`,p(t.p,{children:"Date: March 05, 2024"}),`
`,p(t.h3,{id:"1-data-collection",children:"1. Data Collection"}),`
`,p(t.h4,{id:"11-user-data",children:"1.1 User Data"}),`
`,p(t.p,{children:["GitArchived collects data for analytics through Cloudflare Web Analytics, a service that provides metrics on website usage. Cloudflare Web Analytics stores and utilizes anonymous data regarding visits to the site, including but not limited to information such as visitors\u2019 IP addresses, their user agents, and navigation paths. However, it\u2019s important to emphasize that Cloudflare Web Analytics is designed to strictly respect visitor privacy, adopting an approach that avoids the use of cookies, localStorage, or other client-side tracking methods. Additionally, Cloudflare does not create individual profiles based on this data and is committed to ensuring that the analytics are non-invasive and privacy-respecting. For more information, you can visit the ",p(t.a,{href:"https://www.cloudflare.com/web-analytics/",children:"official Cloudflare Web Analytics website"}),"."]}),`
`,p(t.h4,{id:"12-repository-data",children:"1.2 Repository Data"}),`
`,p(t.p,{children:"GitArchived collects and uses repository data only for internal and operational purposes, such as improving the services offered and managing the platform."}),`
`,p(t.h3,{id:"2-changes-to-the-privacy-policy",children:"2. Changes to the Privacy Policy"}),`
`,p(t.h4,{id:"21-modifications-1",children:"2.1 Modifications"}),`
`,p(t.p,{children:"GitArchived reserves the right to modify the privacy policy at its discretion. Users will be notified in case of changes."}),`
`,p(t.h2,{id:"terms-of-service",children:"Terms of Service"}),`
`,p(t.p,{children:"Date: March 05, 2024"}),`
`,p(t.h3,{id:"1-advertising",children:"1. Advertising"}),`
`,p(t.h4,{id:"11-advertisements",children:"1.1 Advertisements"}),`
`,p(t.p,{children:"GitArchived may display advertisements on the platform to support operational costs and improve user experience. Advertisements may be personalized based on user preferences or content displayed on the platform."}),`
`,p(t.h3,{id:"2-donations",children:"2. Donations"}),`
`,p(t.h4,{id:"21-donations",children:"2.1 Donations"}),`
`,p(t.p,{children:"GitArchived may introduce the possibility of making donations within the platform for the purpose of maintaining it."}),`
`,p(t.h3,{id:"3-changes-to-the-terms-of-service",children:"3. Changes to the Terms of Service"}),`
`,p(t.h4,{id:"31-modifications",children:"3.1 Modifications"}),`
`,p(t.p,{children:"GitArchived reserves the right to modify the terms of service at its discretion. Users will be notified in case of changes."}),`
`,p(t.h2,{id:"4-management-of-repositories",children:"4. Management of Repositories"}),`
`,p(t.h4,{id:"41-deletion",children:"4.1 Deletion"}),`
`,p(t.p,{children:"GitArchived reserves the right to remove a repository from the platform in case of violation of our terms of service or applicable laws. Before proceeding with the deletion, we will do our best to communicate with the owner of the repository and resolve the issue. Users have the right to appeal the deletion decision by submitting an appeal through our dispute resolution process."}),`
